    def get_block_timestamp(self, netuid, hotkey_uid):
        if self._get_archive() is None:
            return None

        try:
            block_at_reg = (
                self._get_endpoint()
                .query_subtensor("BlockAtRegistration", None, [netuid, hotkey_uid])
                .value
            )
            block_hash = self._get_endpoint().get_block_hash(block_at_reg)
            block = self._get_archive().get_block(block_hash=block_hash)

            if block is None:
                print(f"Failed to fetch block data for hash: {block_hash}")
                return None

            timestamp = None

            for extrinsic in block["extrinsics"]:
                if (
                    extrinsic["call"]["call_function"]["name"] == "set"
                    and extrinsic["call"]["call_module"]["name"] == "Timestamp"
                ):
                    timestamp = (
                        int(extrinsic["call"]["call_args"][0]["value"].value) / 1000
                    )
                    break

            if timestamp:
                return datetime.fromtimestamp(timestamp)
            else:
                return None
